function Item(props) {
  return (
    <div>
      <div className="itemName"><b>Name:</b> {props.name}</div>
      <div className="itemPrice">Price: {props.price}</div>
      <div className="itemCategory">Category: {props.category}</div>
      <br />
    </div>
  )
}

export default Item;
